INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 2, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, 0, 0, 1001, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 1.4, 2, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, 0, 0, 1002, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 1.4, 2, "士条 怜", "少しは磨かれると思いますよ。", 1, 0, 0, 0, 1003, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 1.5, 2, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, 0, 0, 1004, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ねぇ…", "風宮あかりです", 1.4, 2, "風宮 あかり", "私といっしょに…\nいかない？", 1, 0, 0, 0, 1006, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "プリンたべたいのー", "出雲宮子なのー", 1.5, 2, "出雲 宮子", "食べ物の恨みは怖いのー", 1, 0, 0, 0, 1007, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 1.4, 2, "虹村 雪", "いいよ。\n見られることは運命さ…", 1, 0, 0, 0, 1008, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 1.4, 2, "柊杏奈", "人呼んで「疾風の冥姫」!!", 1, 0, 0, 0, 1009, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 2, "姫宮 真歩", "ほんまおおきにやわ～♪", 1, 0, 0, 0, 1010, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 1.4, 2, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 1, 0, 0, 0, 1011, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 2, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, 0, 0, 1012, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 1.4, 2, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, 0, 0, 1016, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 1.4, 2, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 1, 0, 0, 0, 1017, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 1.4, 2, "支倉 伊緒", "イオちゃんって呼んでね。", 1, 0, 0, 0, 1018, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 2, "茜 ミミ", "ミミをおいてかないでぇ～", 1, 0, 0, 0, 1020, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 2, "栗林 くるみ", "ふぇぇぇぇぇん……", 1, 0, 0, 0, 1021, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 1.4, 2, "風宮 より", "なんてありがとうございます！", 1, 0, 0, 0, 1022, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 2, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 1, 0, 0, 0, 1023, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 1.4, 2, "天野 すずめ", "これて何か違う…\nあああすみません！", 1, 0, 0, 0, 1025, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 1.4, 2, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 1, 0, 0, 0, 1027, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 2, "佐々木 咲恋", "…そうでしょ？？", 1, 0, 0, 0, 1028, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 1.4, 2, "桜井 望", "あはは、\n私もまだまだだなぁ～", 1, 0, 0, 0, 1029, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 1.4, 2, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, 0, 0, 1030, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 1.4, 2, "上喜 しのぶ", "おかしいですね……", 1, 0, 0, 0, 1031, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 2, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 1, 0, 0, 0, 1033, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 2, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 1, 0, 0, 0, 1034, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "知らない人とは話しちゃいけないので", "氷川鏡華…です", 1.5, 2, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 1, 0, 0, 0, 1036, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "……あ、アラーム。", "柏崎…栞です。", 1.4, 2, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, 0, 0, 1038, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "私、一人も友達がいなくて……", "ふ、双葉碧です。", 1.4, 2, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 1, 0, 0, 0, 1040, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 1.4, 2, "三角 千歌", "そう思っています。", 1, 0, 0, 0, 1042, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 1.4, 2, "安芸 真琴", "う、疑ってすまなかったな…", 1, 0, 0, 0, 1043, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 1.4, 2, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, 0, 0, 1044, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 1.4, 2, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 1, 0, 0, 0, 1045, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 2, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, 0, 0, 1046, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "それでは早速クエストに…", "大神美冬よ！", 1.4, 2, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, 0, 0, 1048, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 1.4, 2, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, 0, 0, 1049, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 1.5, 2, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, 0, 0, 1050, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "？？？？", "？？？", 1.4, 2, "リマ", "？？？？", 1, 0, 0, 0, 1052, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1.5, 2, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 1, 0, 0, 0, 1053, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1.5, 2, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 1, 0, 0, 0, 1058, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1.5, 2, "コッコロ", "そ、そこまでいうなら\nもらってやる", 1, 0, 0, 0, 1059, 1, 0);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 1.5, 2, "キャル", "そ、そこまでいうなら\nもらってやる", 1, 0, 0, 0, 1060, 1, 0);
